import Typewriter from 'typewriter-effect';

export default function Home() {
    return (
        <div className="container ">
            <span>
                <h1>Hello, <br />
                    my name is Yung-Chu, <br />
                    and I am a <Typewriter
                        options={{
                            strings: ['designer', 'gamer', 'researcher', 'developer'],
                            autoStart: true,
                            loop: true,
                            delay: 60,
                            deleteSpeed: 30,
                            pauseFor: 250,
                        }}
                    />
                </h1>
            </span>
        </div>
    );
};
